          const response = await axios.get('https://api.openweathermap.org/data/2.5/onecall?lat=33.578477&lon=-84.340117&units=imperial&appid=96203ae9ca7ca6287795be6c0d2ca9be');
          console.log(response);
          setAstroData=[response.data.current.sunrise,response.data.current.sunset,response.data.daily[0].moonrise,response.data.daily[0].moonset,response.data.daily[0].moon_phase];
          astroDat=setAstroData;
          console.log(astroData);

        } catch (error) {
          console.error(error);
        }
      }
   getData();
   console.log(astroData);
    return(

        <section>
             <article>
             <h1>Astrological Events</h1>

             <strong>Sunrise:</strong> <p>{astroData[0]}</p>
             <strong>Sunset:</strong> <p>{astroData[1]}</p>
            <strong>Moonrise:</strong> <p>{astroData[2]}</p>
            <strong>Moonset:</strong> <p>{astroData[3]}</p>



        </article>

        </section>
    )
}
export default Astro;
